// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Pool is ERC20 {
    string tokenSymbol;
    address tokenAddress;

    struct Liquidity {
        address owner;
        uint256 amount;
        uint256 timestamp;
    }

    Liquidity[] public userLiqudity;
    mapping(address => uint256) public userLimit;

    constructor(string memory _tokenSymbol, address _tokenAddress)
        ERC20(_tokenSymbol, _tokenSymbol)
    {
        tokenAddress = _tokenAddress;
        tokenSymbol = _tokenSymbol;
    }

    modifier hasUserLiqudity(uint256 amount) {
        require(userLimit[msg.sender] >= amount, "User hasnt enough limit");
        _;
    }

    function addLiquidity()
        external
        payable
        returns (uint256)
    {
        userLimit[msg.sender] += msg.value;
        userLiqudity.push(Liquidity(msg.sender, msg.value, block.timestamp));
        mint(msg.sender, msg.value);
        return userLiqudity.length - 1;
    }

    // function deposit(address account, uint256 amount) external {
    //     require(msg.sender == tokenAddress, "Caller is not the token contract");
    //     require(userLimit[account] >= amount, "User hasn't enough limit");
    //     userLimit[account] -= amount;
    //     mintsToken(account, amount);
    // }

    function withdraw(uint256 amount) external payable hasUserLiqudity(amount) {
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Failed to send Ether");
        userLimit[msg.sender] -= amount;
    }

    function mint(address account, uint256 amount) internal {
        // require(msg.sender == tokenAddress, "Caller is not the token contract");
        mintsToken(account, amount);
    }

    function mintsToken(address account, uint256 amount) internal {
        _mint(account, amount);
    }
}

